import { BrowserRouter, Route, Routes } from 'react-router-dom';
import { useNavigate } from 'react-router-dom';
import NewRouteComponent from './NewRouteComponent';


function MyComponent() {
  const navigate = useNavigate();

  const handleClick = () => {
    navigate('/new-route');
  };

  return (
    <button onClick={handleClick}>Navigate to New Route</button>
  );
}
function App() {
  return (
    <>
    <BrowserRouter>
      <Routes>
        <Option1/>
        <Route path="/AdministraterLogin" element={<AdministraterLogin/>} />
        <Route path="/CollegeLogin" element={<CollegeLogin/>} />
        <Route path="/StudentLogin" element={<StudentLogin/>} />

        {/* ... other routes */}
      </Routes>
    </BrowserRouter>
    </>
  );
}

export default App;
